import React from 'react';
import s from './dialogs.module.css';

const Dialogs = (props) => {
    return(
        <div className='dialogs'>
            <div className='dialogs-items'>
                <div className='dialog'>
                    Luda
                </div>
                <div className='dialog'>
                    Sasha
                </div>
                <div className='dialog'>
                    Vika
                </div>
            </div>
            <div className='messages'>
                div.message*3

            </div>
        </div>
    )
};

export default Dialogs;
